import { ArrowLeftOutlined } from "@mui/icons-material"
import { styled } from "styled-components"

const Container = styled.div`

    width: 100%;
    height: 100vh;
    display: flex;

`;

const Arrow = styled.div`
    width: 50px;
    height: 50px;
    background-color: #fff7f7;
    border-radius: 50%;
`;

export const Slider = () => {
    return (
        <Container>

            <Arrow>
                <ArrowLeftOutlined />
            </Arrow>
            <Arrow>
                <ArrowRightOutlined />
            </Arrow>

        </Container>
    )
}
